import time
from bs4 import BeautifulSoup
from selenium import webdriver
import unicodedata
from selenium.webdriver.common.by import By
import os

CHROME_DRIVER_PATH = "/usr/bin/chromedriver"
CHROME_BINARY_LOCATION = "/usr/bin/google-chrome"
chrome_options = webdriver.ChromeOptions()
chrome_options.binary_location = CHROME_BINARY_LOCATION

# URL of the initial page
LISTINGS_URL = "https://asunnot.oikotie.fi/vuokra-asunnot?pagination=1&locations=%5B%5B109,6,%22J%C3%A4rvenp%C3%A4%C3%A4%22%5D%5D&cardType=101&roomCount%5B%5D=2&roomCount%5B%5D=3"
url_1_2 = LISTINGS_URL.split("pagination=1")[0] + "pagination="
url_2_2 = LISTINGS_URL.split("pagination=1")[1]

GOOGLE_FORM_URL = os.environ["GOOGLE_FORM_URL"]

apartments = []

# Function to scrape data from a given HTML content
def scrape_data(html_content):
    soup = BeautifulSoup(html_content, 'html.parser')

    card_divs = soup.find_all('div', class_='cards-v2__card')

    for card_div in card_divs:
        try:
            long_address = card_div.find('div', class_='card-v2-text-container__text--bold').text.strip()
            building_type = card_div.find('div', class_='card-v2-text-container__text--wide').text.strip()
            rooms = card_div.find('div', class_='card-v2-text-container__text--wide').find_next('div').text.strip()
            rent = card_div.find('h2', class_='card-v2-text-container__title').text.strip()
            size = card_div.find_all('h2', class_='card-v2-text-container__title')[1].text.strip()
            link = card_div.find('a', class_='ot-card-v2')['href']

            # normalize the price and remove possible spaces from it
            rent = unicodedata.normalize("NFKD", rent).split(" €")[0]
            if " " in rent:
                rent = rent.replace(" ", "")
            apartment = {"address": long_address.split(",")[0],
                         "area": long_address.split(",")[1],
                         "city": long_address.split(",")[-1],
                         "building_type": building_type.split(",")[0],
                         "year": building_type.split(",")[-1],
                         "rooms": rooms,
                         "rent": unicodedata.normalize("NFKD", rent).split(" ")[0],
                         "size": size.split(" ")[0],
                         "link": link}
            if apartment not in apartments:
                apartments.append(apartment)
        except AttributeError as error:
            print(error)
            pass


def form_poster():
    """Fills google sheet with the scraped information for further analyzing"""
    # Initialize the Selenium webdriver
    driver = webdriver.Chrome()
    for apartment in apartments:
        driver.get(GOOGLE_FORM_URL)
        time.sleep(0.5)
        list_div = driver.find_elements(By.CSS_SELECTOR, 'div[role="list"] input')

        # Extracting input elements from the list_div
        address_input = list_div[0]
        area_input = list_div[1]
        city_input = list_div[2]
        type_input = list_div[3]
        year_input = list_div[4]
        price_input = list_div[5]
        space_input = list_div[6]
        rooms_input = list_div[7]
        url_input = list_div[8]

        # Filling in the input fields with values from the apartment dictionary
        address_input.send_keys(apartment["address"])
        area_input.send_keys(apartment["area"])
        city_input.send_keys(apartment["city"])
        type_input.send_keys(apartment["building_type"])
        year_input.send_keys(apartment["year"])
        price_input.send_keys(apartment["rent"])
        space_input.send_keys(apartment["size"])
        rooms_input.send_keys(apartment["rooms"])
        url_input.send_keys(apartment["link"])
        time.sleep(1)

        buttons = driver.find_elements(By.CSS_SELECTOR, 'div[role="button"]')
        submit_button = buttons[0]
        submit_button.click()
        time.sleep(0.5)

    time.sleep(1)


def scrape_pages(num_pages_to_scrape):
    for page_number in range(1, num_pages_to_scrape + 1):
        url = url_1_2 + str(page_number) + url_2_2
        # Initialize the Selenium webdriver
        driver = webdriver.Chrome()
        # Load the page using Selenium
        driver.get(url)
        # wait for the content to load
        time.sleep(5)
        # Retrieve the HTML source code of the current page
        html_content = driver.page_source
        # Scrape the wanted content
        scrape_data(html_content)
    # # Close the browser window
    # driver.quit()


# Set the desired number of pages to scrape
scrape_pages(1)
